import { Quyz } from "../dist/quyz";

const quyz = new Quyz({
	dev: true,
	colors: false,
});

export { quyz };

import sinon from "sinon";
import assert from "assert";

export const add = sinon.spy((num1: number, num2: number, expected: number) => {
	assert.strictEqual(num1 + num2, expected);
});

import { quyz } from "../../quyz";
const { it, describe, beforeAll } = quyz;

describe("first group", () => {
	it("outer test", () => {});
	describe("nested group", () => {
		it("inner test", () => {});
	});
	describe("with hooks", () => {
		beforeAll(() => {});
		it("test with hook", () => {});
	});
});

import { quyz } from "../../quyz";
import { add } from "./spy";
const { it } = quyz;

it("1 + 1 === 2", () => {
	add(1, 1, 2);
});

const data = [
	[1, 1, 2],
	[3, 3, 6],
];

for (const datum of data) {
	it(
		(num1, num2, expected) => `${num1} + ${num2} === ${expected}`,
		(num1, num2, expected) => {
			add(num1, num2, expected);
		},
		...datum
	);
}
